FeedPackage.Description:
包含一些常用的操作类，大都是静态类，加密解密，反射操作，硬件信息，文档转换，字符串扩展方法，日期时间扩展操作，大文件拷贝，图像裁剪，验证码等常用封装。
示例代码：
1.将Word文档转换为html
DocumentConvert.Doc2Html(@"D:\test.doc", @"D:\test\");

2.检验字符串是否是Email
bool  isEmail="1170397736@qq.com".MatchEmail();

3.获取CPU核心数
int core = SystemInfo.GetCpuCount();

